import React from 'react'

const Post = ({ post: { title, body, img, author }, i }) => {
    return (
        <div>
            <h2>{title}</h2>
            <img src={img}></img>
            <p>{body}</p>
            <p>{author}</p>
            <a>number:{i}</a>
        </div>
    )
}

export default Post
